import React, { useEffect, useState } from 'react';
import { BrowserRouter, Route, Switch, Redirect, useHistory, withRouter } from 'react-router-dom';
import { createUserWithEmailAndPassword, signInWithEmailAndPassword, onAuthStateChanged } from "firebase/auth";
import { auth } from '../firebase/firebase';
import SignIn from '../components/SignIn';
import SignUp from '../components/SignUp';
import Nav from '../components/Nav';
import Home from '../components/Home';
import Dashboard from '../components/Dashboard';

const Router = (props) => {
    const [authState, setAuthState] = useState(localStorage.getItem('authState'));
    const [email, setEmail] = useState(null);
    console.log(authState, 'authstate');

    localStorage.clear();

    onAuthStateChanged(auth, (user) => {
        if (user) {
            // User is signed in, see docs for a list of available properties
            // https://firebase.google.com/docs/reference/js/firebase.User
            const uid = user.uid;
            console.log('authed, router.js');
            localStorage.setItem('authState', true);
            //console.log(auth.currentUser, 'currentUser');
            //setSignedIn(auth.currentUser);
            // ...
        } else {
            // User is signed out
            // ...
        }
    });

    async function submitHandSignIn(e) {
        e.preventDefault();
        console.log('prevented Submit');
    }

    const HomeNav = () => {
        return <Route exact path='/' render={() => {
            return <div><Nav setEmail={setEmail} showSignIn={true} /><Home email={email} setEmail={setEmail} /></div>
        }}></Route>
    };

    const DashboardNav = () => {
        return <Route exact path='/' render={() => {
            return <div><Nav setEmail={setEmail} showSignIn={true} /><Dashboard /></div>
        }}></Route>
    }

    //console.log(auth.currentUser, 'router');

    function PrivateRoute({ children, ...rest }) {
        console.log('children:', children, 'rest:', rest);
        return (
            <Route {...rest} render={() => {
                return authState !== null
                    ? children
                    : <Redirect to='/' />
            }} />
        )
    }

    function PrivateHome({ children, ...rest }) {
        console.log('children:', children, 'rest:', rest, 'location');
        return (
            <Route {...rest} render={() => {
                return authState === null
                    ? children
                    : <Redirect to='/dashboard' />
            }} />
        )
    }

    async function createUser(email, password) {
        createUserWithEmailAndPassword(auth, email, password)
            .then((userCredential) => {
                const user = userCredential.user;
                console.log(user, 'user - createUser');
            })
            .catch((error) => {
                const errorCode = error.code;
                const errorMessage = error.message;
                console.log('error occured', errorCode, errorMessage);
            });
    }

    async function signInUser(email, password) {
        signInWithEmailAndPassword(auth, email, password)
            .then((userCredential) => {
            })
            .catch((error) => {
                const errorCode = error.code;
                const errorMessage = error.message;
                //console.log('sign in error', errorCode, errorMessage);
            });
    }

    return (
        <BrowserRouter>
            <Switch>
                <PrivateHome exact path='/' location={'/dashboard'}>
                    <Nav setEmail={setEmail} showSignIn={true} />
                    <Home email={email} setEmail={setEmail} />
                </PrivateHome>
                <div>
                    <Nav setEmail={setEmail} />
                    <Route exact path='/signin' render={() => <SignIn />} />
                    <Route exact path='/signup'>
                        <SignUp createUser={createUser} setAuthState={setAuthState} email={email} />
                    </Route>
                    <PrivateRoute exact path='/dashboard'>
                        <Dashboard />
                    </PrivateRoute>
                </div>
            </Switch>
        </BrowserRouter >
    );
};

export default withRouter(Router);

